VALUES ('3166352940108', 'Parmentier de poisson', 'Purée 58,9% [eau, crème fraîche légère (contient _lait_) 16,1%, flocons de pommes de terre 7,3% (pommes de terre déshydratées, émulsifiant : E471), _lait_ écrémé en poudre, farine de _blé_, ail, arôme naturel (contient : _poisson_, _mollusques_, _lait_, _céleri_), sel, extraits d\'épices, poivre, curcuma], _poisson_ (colin d\'Alaska) 21,9%, carottes 4,5%, courgettes 4,5%, brocolis 3,6%, chapelure (farine de _blé_, levure, sel, épices), vin blanc 2%, échalotes 1%, persil 0,03%.', 'https://static.openfoodfacts.org/images/products/316/635/294/0108/front_fr.27.400.jpg', '2.8', '1.7', '12', '2.9', '1', '6.6', '0.8', '0.31496062992126', '', '1');

