VALUES ('3170870005287', 'Grenache rosé pays d\'OC', 'OULEURS DU UD TERROIR LITTORAL Sud de France L\'Amphithéatre du Languedoc Au sein de ce Terroir Littoral, notre culture de la vigne y est unique grâce à l\'influence du climat méditerranéen. Ils\'étendant d\'Est en Ouest sur 200 kn depuis Aigues-Mortes jusqu \'à Perpi- gnan sur une bande de 15 km de large cette immense façade exposée plein sud et balayée par les vents marins, le mistral et la tramon- tane. Le vent marin doux et humide caresse les vignes qui plongent leurs racines dans des sols plats de calcaires maritime est TERROIR LITTORAL et de jeunes de limons fertiles.&gt;&gt; NOTES DE DÉGUSTATION ROBE NEZ LCHE Rose pale. Friand aux aromes de framboise et de cassis. Ronde et délicate offrant une grande fraicheur jusqu\'à la fin de la dégustatie Servi à 12 C, ce Grenache Rosé Couleurs du Sud accompagnera parfaitement les grillades et les brochettes de poulet. LÉGER ÉPICÉ PUISSAN FRUITE 3170870 005287', 'https://static.openfoodfacts.org/images/products/317/087/000/5287/front_fr.6.400.jpg', '', '', '', '', '', '', '', '', '', '1');

