a soarelui, ulei de portocale, aromà. Cacao: minimum în ciocolatà. Poate contine urme de fructe cu coajà, gluten si lapte. A se consuma, de preferinü, înainte de sfâr;itul: a se vedea mai jos. A se pàstra într-un loc uscat si ràcoros. Produs in Franta. @Horkâ éokolâda s presladenou pomaranéovou kôrou (5%) - Zloienie: kakaovâ hmota, Cukor, odtuéneny kakaovy prâSok, presladenâ pomaranéovâ kôra (5 %) [pomaranéovâ kôra, Cukor, dextrôza, regulâtor kyslosti: kyselina citrônovâl, kakaové maslo, emulgâtor: slneénicovy lecitin, pomaranéovy olej, arôma. Kakaovâ suSina v horkej éokolâde minimâlne 70 0%. Müe obsahovat\' stopy orechov, gluténu a mlieka. Minimâlna trvanlivost\'do konca: vid détum na zadnej strane obalu. Skladujte v Ahu, chrâhte pred teplom. Vyrobené vo Francüzsku. (Ü) TbMeH UJOKonaa 3axapocaHh nOPTOlŒJlOBh Kopn (5 %) - CbCTaBKn: KaŒOBa Maca, 3axap, HVOCKOMacneHO Kaao Ha npax, 3axapocaH)l nopToŒf10BVl 5% (nopTOKan0B)l KOPVI, 3axap, geKCTP03a, pernaTop Ha KVlceJlVlHHOCTTa: fli4MOHeHa KVlceflVlHa), KaŒOBO Macno, ewnraTop: coeB ne14VlTVlH, eceHUVlanHO nopT0KanoB0 Macno, BaHhf10Ba eceHL114R. KaŒo: 70 % B LLIOKonag. Moye Aa CbAbP&gt;Ka cneAVl OT rJlYTeH n MJIRKO. Hai-A06bp Kpaq Ha: 3aAHaTa yacT Ha onaK0BŒTa. Aa ce CbxpaH9Ba Ha cyxo xnaAH0 (Ipo)13BegeH0 BbB OpaHAV19.', 'https://static.openfoodfacts.org/images/products/317/328/143/4530/front_fr.4.400.jpg', '35', '21', '38', '33', '16', '8.3', '0.03', '0.0118110236220472', '', '0');

